import { Link } from 'react-router-dom';
import './Services.css';

const defaultServices = [
  {
    title: 'Website Development',
    desc: 'Custom websites built with responsive design and best practices.',
    icon: 'ðŸŒ',
    color: '#667eea',
    price: 'Starting from â‚¹1999',
    features: ['Responsive Design', 'SEO Optimized', 'Fast Loading', 'Mobile Friendly']
  },
  {
    title: 'E-commerce Solutions',
    desc: 'Complete online store development with payment integration and inventory management.',
    icon: 'ðŸ›’',
    color: '#764ba2',
    price: 'Starting from â‚¹4999',
    features: ['Payment Gateway', 'Inventory Management', 'Order Tracking', 'Admin Panel']
  },
  {
    title: 'Web Applications',
    desc: 'Custom web applications tailored to your specific business requirements.',
    icon: 'âš¡',
    color: '#f093fb',
    price: 'Starting from â‚¹8999',
    features: ['Custom Features', 'Database Design', 'API Integration', 'User Management']
  },
  {
    title: 'UI/UX Design',
    desc: 'Beautiful and intuitive user interfaces that enhance user experience.',
    icon: 'ðŸŽ¨',
    color: '#4facfe',
    price: 'Starting from â‚¹2999',
    features: ['Wireframing', 'Prototyping', 'User Testing', 'Design System']
  },
  {
    title: 'Website Maintenance',
    desc: 'Ongoing support and maintenance to keep your website running smoothly.',
    icon: 'ðŸ”§',
    color: '#43e97b',
    price: 'Starting from â‚¹999/month',
    features: ['Regular Updates', 'Security Monitoring', 'Backup Management', 'Performance Optimization']
  },
  {
    title: 'SEO & Marketing',
    desc: 'Search engine optimization and digital marketing to grow your online presence.',
    icon: 'ðŸ“ˆ',
    color: '#fa709a',
    price: 'Starting from â‚¹1999/month',
    features: ['Keyword Research', 'Content Optimization', 'Analytics Tracking', 'Performance Reports']
  }
];

function Services() {
  const [isVisible, setIsVisible] = useState(false);
  const [services] = useState(defaultServices);
  const miniServices = [
    { title: 'Web Design', icon: 'ðŸŽ¨', color: '#4facfe' },
    { title: 'Web Development', icon: 'ðŸ’»', color: '#667eea' },
    { title: 'E-commerce', icon: 'ðŸ›’', color: '#764ba2' },
    { title: 'UI/UX', icon: 'ðŸ§©', color: '#f093fb' },
    { title: 'Maintenance', icon: 'ðŸ”§', color: '#43e97b' },
    { title: 'SEO/Marketing', icon: 'ðŸš€', color: '#fa709a' }
  ];

  useEffect(() => {
    setIsVisible(true);
  }, []);

  return (
    <div className="services-page">
      <section className="services-section">
        <div className="container">
          {/* Section Header */}
          <div className="section-header">
            <h2 className="section-title">Our Services</h2>
            <p className="section-subtitle">
              Comprehensive web development solutions tailored to your business needs
            </p>
          </div>

          {/* Mini Services - Quick Overview */}
          <div className="mini-services">
            <div className="mini-services-grid">
              {miniServices.map((item, idx) => (
                <Link
                  to="/contact"
                  key={item.title}
                  className={`mini-card ${isVisible ? 'animate-in' : ''}`}
                  style={{ animationDelay: `${idx * 0.06}s` }}
                  aria-label={`Get ${item.title}`}
                >
                  <span
                    className="mini-icon"
                    style={{ background: `${item.color}20`, color: item.color }}
                  >
                    {item.icon}
                  </span>
                  <span className="mini-title">{item.title}</span>
                </Link>
              ))}
            </div>
          </div>

          <div className="services-grid">
            {services.map((service, index) => (
              <div 
                key={service.title} 
                className={`service-card ${isVisible ? 'animate-in' : ''}`}
                style={{ animationDelay: `${index * 0.1}s` }}
              >
                <div className="service-card-inner">
                  <div className="service-header">
                    <div className="service-icon" style={{ background: `${service.color}20`, color: service.color }}>
                      <span>{service.icon}</span>
                    </div>
                    <div className="service-badge" style={{ background: service.color }}>
                      Popular
                    </div>
                  </div>

                  <div className="service-content">
                    <span className="service-label">Services</span>
                    <h3 className="service-title" style={{ color: service.color }}>
                      {service.title}
                    </h3>
                    <p className="service-description">{service.desc}</p>

                    <div className="service-features">
                      <h4>Key Features:</h4>
                      <ul>
                        {service.features.map((feature, idx) => (
                          <li key={idx}>
                            <span className="feature-check" style={{ color: service.color }}>âœ“</span>
                            <span>{feature}</span>
                          </li>
                        ))}
                      </ul>
                    </div>
                  </div>

                  <div className="service-footer">
                    <div className="service-price">{service.price}</div>
                    <Link to="/contact" className="btn btn-primary">
                      Get Started
                      <span className="btn-icon">â†’</span>
                    </Link>
                  </div>
                </div>

                <div className="service-highlight" style={{ background: service.color }}></div>
              </div>
            ))}
          </div>
        </div>
      </section>
    </div>
  );
}

export default Services;
